import React, { useState } from "react";
import Test from "./Test";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  FormLabel,
  Radio,
} from "@material-ui/core";
export default function Intro(props) {
  const [test, setTest] = useState("");

  const onChangeTest = (e) => {
    setTest(e.target.value);
  };

  const startTest = () => {
    alert("검사를 시작합니다");
    props.history.push("/test");
  };

  return (
    <Box style={{ width: "100%" }}>
      <Grid container justify="center">
        <h1>검사예시</h1>
        <Grid container justify="center">
          <p>
            직업과 관련된 두 개의 가치 중에서 자기에게 더 중요한 가치에
            표시하세요.
            <br />
            가치의 뜻을 잘 모르겠다면 문항 아래에 있는 가치의 설명을 확인해
            보세요.
          </p>
          <p>두 개의 가치 중에 자신에게 더 중요한 가치를 선택하세요.</p>
          <FormControlLabel
            value="1"
            control={<Radio color="primary" />}
            label="능력발휘"
            onChange={onChangeTest}
          />
          <FormControlLabel
            value="1"
            control={<Radio color="primary" />}
            label="자율성"
            onChange={onChangeTest}
          />
        </Grid>
        <br />

        <Button
          disabled={test == "" ? true : false}
          variant="contained"
          color="primary"
          onClick={startTest}
        >
          검사 시작
        </Button>
      </Grid>
    </Box>
  );
}
